const initialState = {
  searchId: '',
  data: {},
};

export const dataReducer = (state = initialState, action) => {
  switch (action.type) {
    case 'GET_SEARCH_ID': 
      return {...state, searchId: {...action.pa}};
    case 'GET_TICKETS_DATA':
      return state.data;
    default:
      return state;
  }
}
